INSERT INTO `programa` VALUES (1,NULL,3,122,2019,'<p>Cecilia</p>\r\n<p>Carolina</p>','<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>BIBLIOGRAFIA B&Aacute;SICA:</strong></span></span></p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Apuntes de c&aacute;tedra.</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\">Introduccion_a_la_programacion_con_la_computadora.pdf</span></span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\"><strong>BIBLIOGRAF&Iacute;A DE CONSULTA</strong></span></span></span><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\">:</span></span></span></p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">http://php.net/manual/es/getting-started.php</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">http://php.net/manual/es/indexes.examples.php</span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><br /><br /></p>','<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>BIBLIOGRAFIA B&Aacute;SICA:</strong></span></span></p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Apuntes de c&aacute;tedra.</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\">Introduccion_a_la_programacion_con_la_computadora.pdf</span></span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\"><strong>BIBLIOGRAF&Iacute;A DE CONSULTA</strong></span></span></span><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><span lang=\"es-ES\">:</span></span></span></p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">http://php.net/manual/es/getting-started.php</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">http://php.net/manual/es/indexes.examples.php</span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" lang=\"es-ES\" style=\"margin-bottom: 0.35cm;\"><br /><br /></p>','<p style=\"text-align: justify;\">Introducci&oacute;n a la Programaci&oacute;n, constituye una de las asignaturas troncales de la carrera, y forma parte del conjunto de materias del segundo cuatrimestre; est&aacute; dise&ntilde;ada para formar al alumnos en los conceptos b&aacute;sicos de programaci&oacute;n, m&eacute;todos de trabajo, t&eacute;cnicas y herramientas para abordar la resoluci&oacute;n de problemas, como una manera de introducirlo en el desarrollo de su formaci&oacute;n profesional que se ir&aacute; completando y profundizando en las materias correlativas del plan. Como punto de partida el alumno adquirir&aacute; herramientas para abordar las estrategias en la resoluci&oacute;n de problemas, m&eacute;todos de dise&ntilde;o de algoritmos y la introducci&oacute;n al lenguaje de programaci&oacute;n PHP. Se ha elegido este lenguaje de programaci&oacute;n multiparadigma, ya que soporta orientaci&oacute;n a objetos, programaci&oacute;n imperativa y, programaci&oacute;n funcional.</p>','<ul>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Algoritmos. </span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">M&eacute;todos para encarar la resoluci&oacute;n de problemas con computadora.</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Programas. Estructura General de un programa. </span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Tipos de datos primitivos. Estructuras de control.</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Procedimientos y funciones. Estructura de datos: arreglos.</span></span></p>\r\n</li>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\" align=\"justify\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">T&eacute;cnicas y principios de scripting.</span></span></p>\r\n</li>\r\n</ul>','<p class=\"western\" style=\"margin-left: 1.3cm; text-indent: 1.2cm; margin-bottom: 0.35cm; line-height: 115%; orphans: 2; widows: 2;\" align=\"left\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Poder resolver problemas de algor&iacute;tmicos, procesos de dise&ntilde;o e implementaci&oacute;n de software. Debido a la gran brecha conceptual existente entre el enunciado del problema se deben transitar las siguientes etapas:</span></span></p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Adquiera habilidad en la detecci&oacute;n de una situaci&oacute;n de problema y en el planteo de los posibles caminos de soluci&oacute;n mediante las t&eacute;cnicas generales de resoluci&oacute;n de problemas.</span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" style=\"margin-left: 2.5cm; margin-bottom: 0cm; line-height: 100%;\">&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Resuelva problemas en un lenguaje de dise&ntilde;o de algoritmos.</span></span></p>\r\n</li>\r\n</ul>\r\n<p class=\"western\" style=\"margin-left: 2.5cm; margin-bottom: 0cm; line-height: 100%;\">&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p class=\"western\" style=\"margin-bottom: 0cm; line-height: 100%;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Pueda transformar el algoritmo de programaci&oacute;n dise&ntilde;ado a un programa escrito en el lenguaje elegido.</span></span></p>\r\n</li>\r\n</ul>','<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 1: Estrategias de Resoluci&oacute;n de Problemas</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Tipos de problemas, representaciones: descripci&oacute;n verbal, de diagrama, de matem&aacute;tica.</span></span> <span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Estrategias de resoluci&oacute;n: abstracci&oacute;n, inferencia, razonamiento hacia atr&aacute;s, afinidades entre problemas.</span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 2: Dise&ntilde;o de Algoritmos</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Algoritmos: definici&oacute;n, propiedades, especificaci&oacute;n y ejecuci&oacute;n de Algoritmos. Estructura Secuencial: An&aacute;lisis del algoritmo. Tratamiento de Datos. Manipulaci&oacute;n de datos. Dise&ntilde;o de Algoritmos. Se utilizar&aacute; la metodolog&iacute;a Pseudo c&oacute;digo para la resoluci&oacute;n de algoritmos.</span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 3: Introducci&oacute;n a la Programaci&oacute;n </strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Conceptos b&aacute;sicos. Proceso de programaci&oacute;n, tipos de lenguajes de programaci&oacute;n y de software. Comunicaci&oacute;n Hombre-M&aacute;quina. Lenguajes de alto y bajo nivel. Compiladores e Int&eacute;rpretes. Tipos de Software. Datos de entrada y Salida. Variables, Tipos y Asignaciones. Dise&ntilde;o de un algoritmo: Diagrama de L&iacute;neas. Especificaci&oacute;n del algoritmo. Ejecuci&oacute;n y Verificaci&oacute;n: Traza de un algoritmo </span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 4: Programaci&oacute;n PHP</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Introducci&oacute;n al Lenguaje Php. Estructura y conceptos b&aacute;sicos de un programa. Tipos de datos: simples y estructurados. Sintaxis del lenguaje. &Aacute;mbito de influencia de las variables. Arreglos unidimensionales y bidimensionales: </span></span><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Tipos de datos estructurados: cadenas de caracteres, arreglos unidimensionales y bidimensionales. Concepto de biblioteca.</span></span></p>','<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 1: Estrategias de Resoluci&oacute;n de Problemas</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Tipos de problemas, representaciones: descripci&oacute;n verbal, de diagrama, de matem&aacute;tica.</span></span> <span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Estrategias de resoluci&oacute;n: abstracci&oacute;n, inferencia, razonamiento hacia atr&aacute;s, afinidades entre problemas.</span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 2: Dise&ntilde;o de Algoritmos</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Algoritmos: definici&oacute;n, propiedades, especificaci&oacute;n y ejecuci&oacute;n de Algoritmos. Estructura Secuencial: An&aacute;lisis del algoritmo. Tratamiento de Datos. Manipulaci&oacute;n de datos. Dise&ntilde;o de Algoritmos. Se utilizar&aacute; la metodolog&iacute;a Pseudo c&oacute;digo para la resoluci&oacute;n de algoritmos.</span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 3: Introducci&oacute;n a la Programaci&oacute;n </strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Conceptos b&aacute;sicos. Proceso de programaci&oacute;n, tipos de lenguajes de programaci&oacute;n y de software. Comunicaci&oacute;n Hombre-M&aacute;quina. Lenguajes de alto y bajo nivel. Compiladores e Int&eacute;rpretes. Tipos de Software. Datos de entrada y Salida. Variables, Tipos y Asignaciones. Dise&ntilde;o de un algoritmo: Diagrama de L&iacute;neas. Especificaci&oacute;n del algoritmo. Ejecuci&oacute;n y Verificaci&oacute;n: Traza de un algoritmo </span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\"><strong>Unidad 4: Programaci&oacute;n PHP</strong></span></span></p>\r\n<p class=\"western\" style=\"margin-left: 1.25cm; margin-bottom: 0.35cm;\"><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Introducci&oacute;n al Lenguaje Php. Estructura y conceptos b&aacute;sicos de un programa. Tipos de datos: simples y estructurados. Sintaxis del lenguaje. &Aacute;mbito de influencia de las variables. Arreglos unidimensionales y bidimensionales: </span></span><span style=\"font-family: Times New Roman, serif;\"><span style=\"font-size: small;\">Tipos de datos estructura