1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\"><strong><span style=\"font-size: medium;\">&nbsp;</span></strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"border-bottom: 1px solid #000000; border-left: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\" height=\"20\"><strong><span style=\"font-size: medium;\">VII</span></strong></td>\r\n<td style=\"border-bottom: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\"><strong><span style=\"font-size: medium;\">**</span></strong></td>\r\n<td style=\"border-bottom: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\"><strong><span style=\"font-size: medium;\">&nbsp;</span></strong></td>\r\n<td style=\"border-bottom: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\"><strong><span style=\"font-size: medium;\">**</span></strong></td>\r\n<td style=\"border-bottom: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\"><strong><span style=\"font-size: medium;\">**</span></strong></td>\r\n<td style=\"border-bottom: 1px solid #000000; border-right: 1px solid #000000; width: 91px;\" align=\"center\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>La totalidad de la bibliograf&iacute;a propuesta se encuentra en formato digital y de libre disponibilidad, de acuerdo con los t&eacute;rminos de las respectivas licencias.<br />Los apuntes de c&aacute;tedra se encuentran a disposici&oacute;n de los estudiantes.</p>','<h4>Del Programa</h4>\r\n<p><br />La utilizaci&oacute;n del Software Libre ha gestado un cambio tecnol&oacute;gico y cultural que requiere de un estudio especializado. <br />Es as&iacute; que, en concordancia con el objetivo principal de la carrera, el contenido de la signatura se ha dise&ntilde;ado con la finalidad de formar a los estudiantes en el conocimiento y empleo de procedimientos, modelos, t&eacute;cnicas y herramientas que les permitan abordar la problem&aacute;tica relativa a la implementaci&oacute;n de tecnolog&iacute;as libres, entendi&eacute;ndose como tal todos aquellos modernos desarrollos tecnol&oacute;gicos que comparten el esp&iacute;ritu del Software Libre.</p>\r\n<p><br />Por tal motivo se presentan los aspectos espec&iacute;ficos del paradigma, con el foco en su definici&oacute;n y las consecuencias que implica su utilizaci&oacute;n.</p>\r\n<h4><br />De la estructura de c&aacute;tedra</h4>\r\n<p><br />El equipo de c&aacute;tedra est&aacute; conformado de acuerdo con las pol&iacute;ticas de designaci&oacute;n establecidas y la cantidad de estudiantes matriculados a la asignatura.</p>','<ul>\r\n<li>Conocer los aspectos t&eacute;cnicos, legales, econ&oacute;micos y sociales que distinguen al Software Libre y de C&oacute;digo Abierto.</li>\r\n<li>Conocer las formas de analizar, evaluar y utilizar las fuentes de documentaci&oacute;n y soporte del Software Libre y de C&oacute;digo Abierto.</li>\r\n</ul>','<p>Se pretende que el estudiante adquiera una visi&oacute;n general del paradigma del Software Libre, desarrollando las habilidades te&oacute;rico-pr&aacute;cticas que le permitan:</p>\r\n<ul>\r\n<li>Conocer los aspectos t&eacute;cnicos, legales, econ&oacute;micos y sociales que distinguen al modelo.</li>\r\n<li>Dominar las formas de analizar, evaluar y utilizar las fuentes de documentaci&oacute;n y soporte del Software Libre.</li>\r\n<li>Desarrollar habilidades en la resoluci&oacute;n de problemas, trabajando tanto de forma aut&oacute;noma como en equipo.</li>\r\n</ul>','<p>Las licencias de software. Software Libre y Open Source. Comparaci&oacute;n. Ventajas de la disponibilidad del c&oacute;digo fuente. Modelos de desarrollo abiertos y colaborativos. Aspectos legales y de explotaci&oacute;n del Software Libre. Implantaci&oacute;n de sistemas de Software Libre. <br />Factibilidad. Aspectos econ&oacute;micos y modelos de negocio del Software Libre. Costo total de operaci&oacute;n. Comparaci&oacute;n con otras alternativas. El Software Libre en el sector p&uacute;blico, en la educaci&oacute;n y en la empresa.</p>','<h4>Unidad 1: Introducci&oacute;n al Software Libre</h4>\r\n<p>Introducci&oacute;n. Software Libre y C&oacute;digo Abierto. Aspectos &eacute;ticos. Implicancias sociales. Localizaci&oacute;n. Proyectos libres.</p>\r\n<h4>Unidad 2: Aspectos t&eacute;cnicos</h4>\r\n<p>Proyectos de Software Libre. Modelo de desarrollo. Infraestructura tecnol&oacute;gica. Manejo de documentaci&oacute;n y soporte. Seguridad.</p>\r\n<h4>Unidad 3: Aspectos legales</h4>\r\n<p>Dominio P&uacute;blico, <em>Copyright</em>, <em>Copyleft</em> y&nbsp; Licencias de Software. Licenciamiento <em>FSF</em>, <em>Creative Commons</em>, <em>OSI</em> y otros.</p>\r\n<h4>Unidad 4: Uso y aplicaci&oacute;n de Software Libre</h4>\r\n<p>Costo total de operaci&oacute;n. Estudio de costo/beneficio. Procesos de migraci&oacute;n.</p>\r\n<h4>Unidad 5: Producci&oacute;n de Software Libre y con Software Libre</h4>\r\n<p>Modelos de negocio. Colaboraci&oacute;n en proyectos. Organizaciones y software. Administraci&oacute;n p&uacute;blica, educaci&oacute;n p&uacute;blica, sector privado.</p>','<p>Las especiales caracter&iacute;sticas del objeto de la asignatura permiten potenciar el paradigma b&aacute;sico de la ense&ntilde;anza universitaria tradicional y llevarla a un plano innovador. El uso de Internet y de medios audiovisuales integrados posibilitan la vinculaci&oacute;n entre el cuerpo docente y los estudiantes con independencia del tiempo y de las instancias presenciales. <br />Es por eso que la propuesta metodol&oacute;gica se basar&aacute; en estrategias propias de una ense&ntilde;anza activa, centrada en el trabajo te&oacute;rico-pr&aacute;ctico, con utilizaci&oacute;n de todos los elementos t&eacute;cnicos disponibles que las propias tecnolog&iacute;as proporcionan, tal el caso de simuladores. <br />La exposici&oacute;n y fundamentaci&oacute;n de los conceptos b&aacute;sicos se aplicar&aacute;n inmediatamente a situaciones reales, particularmente ajustadas al perfil del futuro egresado. Se presentar&aacute;n propuestas de trabajo que permitan la interacci&oacute;n a trav&eacute;s de grupos, reales y virtuales, para potenciar el aprendizaje y favorecer la cooperaci&oacute;n.<br />Se utilizar&aacute;n herramientas de Software Libre, centrando la atenci&oacute;n en las particularidades de los programas y en la filosof&iacute;a de trabajo subyacente. <br />Se insistir&aacute; especialmente en las t&eacute;cnicas y en el desarrollo de la capacidad para abordar problemas nuevos por parte del estudiante, aportando soluciones conocidas o generando nuevas alternativas.</p>','','','','','','2019-02-27 15:03:26','2019-02-27 15:15:16',81,83);
